import React from "react";
import { useNavigate } from "react-router-dom";
import AboutMe from "./Components/AboutMe";
import Navigation from "./Components/Navigation";
import Testimonials from "./Components/Testimonials";
import Resume from "./Components/Resume";

function Home() {
    let navigate = useNavigate();
  return (
    <div className="home">
        {/* <Navigation /> */}
        <AboutMe />
        <div className="caseStudies">
            <div className="card" onClick={()=>{navigate("/work/JasonClerkID")}}><img src="./logos/JC logo.svg" alt="Jason Clerk ID logo"></img></div>
            <div className="card" onClick={()=>{navigate("/work/SugarFlower")}}><img src="./logos/SugarFlower logo.svg" alt="Sugar and Flower logo"></img></div>
            <div className="card" onClick={()=>{navigate("/work/Canada150")}}><img src="./logos/Canada 150 logos.svg" alt="Canada 150 logos"></img></div>
            <div className="card" onClick={()=>{navigate("/work/McDonaldsGCTA")}}><img src="./logos/McDonald's logo.svg" alt="McDonald's logo"></img></div>
        </div>
        <Testimonials />
        <Resume />
    </div>
  );
}

export default Home;
